		//reconnect: true
	});
	
    Client.subscribe('EURUSD:CUR');


    Client.on('message', function(msg){
        console.log('\n Data from TradingEconomics stream: ', msg.topic);
        console.log(msg);
    
        //parse/save msg to DB
    });


  return <div>hola</div>;
};

